import React from 'react';
import { useFormik } from 'formik';

const Temp = () => {

    const formik = useFormik({
        initialValues: {
            category: '',
            language: '',
            blacklistFlags: {'single':true,'twopart':true},
            type: {'single':true,'twopart':true},
            conatains: '',
            idRange:{'from':0,'to':1368},
            amount: '1'

        },
        onSubmit: values => {
            console.log(values)
        },
    });
    const getData = () => {
        // fetch('https://v2.jokeapi.dev/joke/Any?amount=10')
        // .then((response) => response.json())
        // .then((response) => console.log(response))


    }
    return (
        <div className='container'>
            <form onSubmit={formik.handleSubmit}>
                <div className='md-6' style={{ margin: '20px' }}>
                    <label htmlFor="category">Select category/categories</label>
                    <select
                        id="category"
                        name="category"
                        type="select"
                        onChange={formik.handleChange}
                        value={formik.values.category}
                        onBlur={formik.handleBlur}>
                        <option value="Programming">Programming</option>
                        <option value="Misc">Misc</option>
                        <option value="Dark">Dark</option>
                        <option value="Pun">Pun</option>
                        <option value="Spooky">Spooky</option>
                        <option value="Christamas">Christamas</option>

                    </select>
                </div>
                <div className='md-6' style={{ margin: '20px' }}>
                    <label htmlFor="language">Select Language</label>
                    <select
                        id="language"
                        name="language"
                        type="select"
                        onChange={formik.handleChange}
                        value={formik.values.language}
                        onBlur={formik.handleBlur}>

                        <option value="cs">cs - Czech</option>
                        <option value="de">de - German</option>
                        <option value="en">en - English</option>
                        <option value="es">es - Spanish</option>
                        <option value="fr">fr - French</option>
                        <option value="pt">pt - Portuguese</option>
                    </select>
                </div>

                <div className='md-6' style={{ margin: '20px' }}>
                    <label htmlFor="email">Select  Flags to Blacklist</label>
                    &nbsp;&nbsp;&nbsp; (optional)&nbsp;&nbsp;&nbsp;
                    <input  id="blacklistFlags.nsfw"
                        name="type.single"
                        onChange={formik.handleChange}
                        value={formik.values.type.single}
                    type="checkbox" id="blacklistFlags.nsfw" /><label htmlFor="blf-cb1">nsfw</label>
                    <input type="checkbox" id="blf-cb2" /><label htmlFor="blf-cb2">religious</label>
                    <input type="checkbox" id="blf-cb3" /><label htmlFor="blf-cb3">political</label>
                    <input type="checkbox" id="blf-cb4" /><label htmlFor="blf-cb4">racist</label>
                    <input type="checkbox" id="blf-cb5" /><label htmlFor="blf-cb5">sexist</label>
                    <input type="checkbox" id="blf-cb6" /><label htmlFor="blf-cb6">explicit</label>

                </div>
                <div className='md-6' style={{ margin: '20px' }}>
                    <label htmlFor="twopart">Select jock type</label>

                    <input id="type.single"
                        name="type.single"
                        onChange={formik.handleChange}
                        value={formik.values.type.single}
                        onBlur={formik.handleBlur} type="checkbox" id="blf-cb1" /><label htmlFor="blf-cb1">singel</label>
                    <input id="type.twopart"
                        name="type.twopart"
                        onChange={formik.handleChange}
                        value={formik.values.type.twopart}
                        onBlur={formik.handleBlur} type="checkbox" id="blf-cb2" /><label htmlFor="blf-cb2">twopart</label>

                </div>

                <div className='md-6' style={{ margin: '20px' }}>
                    <label htmlFor="email">Search for a joke that contains this search string:</label>

                    <input id="conatains"
                        name="conatains"
                        type="select"
                        onChange={formik.handleChange}
                        value={formik.values.conatains}
                        onBlur={formik.handleBlur} type="text" placeholder='(optional)' />


                </div>

                <div className="multiselect noselect" id="idRangeWrapper" style={{ borderColor: 'initial' }}>
                    <label htmlFor="idRange">Search for a joke in this ID range:</label>
                    (optional)&nbsp;&nbsp;&nbsp;

                    From: <input id="idRange.from"
                        name="idRange.from"
                        onChange={formik.handleChange}
                        value={formik.values.idRange.from}
                        onBlur={formik.handleBlur} type="number" id="idRangeInputFrom"  min="0" step="1" max="1368" />
                    To: <input id="idRange.to"
                        name="idRange.to"
                        onChange={formik.handleChange}
                        value={formik.values.idRange.to}
                        onBlur={formik.handleBlur} type="number" id="idRangeInputTo"  min="0" step="1" max="1368" />
                </div>

                <div className='md-6' style={{ margin: '20px' }}>
                    <label htmlFor="email">Number of jokes:</label>
                    <input id="amount"
                        name="amount"
                        onChange={formik.handleChange}
                        value={formik.values.amount}
                        onBlur={formik.handleBlur} type="number" id="jokesAmountInput"  min="1" step="1" 
                        onChange={formik.handleChange} max="10">

                    </input>
                </div>



                <button onClick={() => getData()} >click</button>

                <button type="submit">Submit</button>
            </form>
        </div>
    );
};
export default Temp
